import React from 'react';
// Using a placeholder image instead of the missing Sticker.gif
// You can replace this with your actual robot image when available
const placeholderImage = "https://img.icons8.com/color/240/000000/robot--v2.png";

const AuthLayout = ({ children }) => {
  return (
    <div className="auth-container">
      <div className="auth-left-section">
        <img src={placeholderImage} alt="Chatbot" className="w-full max-w-[250px] h-auto" />
      </div>
      <div className="auth-right-section">
        <div className="auth-form-box">
          <div className="auth-logo">
            <img
              src="https://img.icons8.com/fluency/48/000000/chatbot.png"
              alt="Logo"
              className="w-12"
            />
            <h2 className="text-2xl text-primary-dark">
              MIND<span className="text-primary-light">EASE</span>
            </h2>
          </div>
          {children}
        </div>
      </div>
    </div>
  );
};

export default AuthLayout;
